import React from "react";
import { Routes, Route } from "react-router-dom";
import Topbar from "../../component/Topbar";
import Sidebar from "../../component/Sidebar";
import "./app.css"

function App() {
  return (
    <div className="App">
      <div class="row">
        <div class="col-sm-2 flex">
          <Sidebar />
        </div>
        <div class="col-sm-10 flex1 hijau">
          <Topbar />
            <div class="row">
              <div class="col-sm-44">.col-6 .col-md-4</div>
              <div class="col-sm-6">.col-6 .col-md-4</div>
            </div>
        </div>
      </div>
    </div>
  );
}

export default App;
